import React from 'react'

export default function Header() {
  return (
    <div className="button">
      <button id='Home'></button>
      <button>Catalog</button>
      <button>Main Page</button>
      <button>All products</button>
      <button>All sales</button>
      <button></button>
    </div>
  )
}
